import Card from "../components/Card.js";

export default function MainPage() {
  return (
    <div>
      <Card
        image={
          "https://www.advantagepetcare.com.au/sites/g/files/adhwdz311/files/styles/paragraph_image/public/2020-07/istock-802799294_unrestricted_1110x800.jpg?itok=R51kcQGy"
        }
        title={"30 Minute Walk"}
        description={"Short walk around your neighborhood"}
      />

      <Card
        image={
          "https://www.advantagepetcare.com.au/sites/g/files/adhwdz311/files/styles/paragraph_image/public/2020-07/istock-802799294_unrestricted_1110x800.jpg?itok=R51kcQGy"
        }
        title={"60 Minute Walk"}
        description={"An hour long walk around the bneighborhood"}
      />
    </div>
  );
}
